import React from "react";
import Sidebar from "../components/Sidebar";
import WelcomeCards from "../components/WelcomeCards";

const Dashboard = () => {
  return (
    <div className="dashboard-wrapper">
      <Sidebar />
      <main className="dashboard-content">
        <WelcomeCards />
      </main>
    </div>
  );
};

export default Dashboard;
